fields.calculatedFormula:
IF(
  ISBLANK(Website),
  "",
  LOWER(
    LEFT(
      SUBSTITUTE(
        SUBSTITUTE(
          SUBSTITUTE(
            SUBSTITUTE(
              Website,
              "https://", ""
            ),
            "http://", ""
          ),
          "www.", ""
        ),
        "/",
        "~"
      ),
      FIND("~", SUBSTITUTE(
        SUBSTITUTE(
          SUBSTITUTE(
            SUBSTITUTE(
              Website,
              "https://", ""
            ),
            "http://", ""
          ),
          "www.", ""
        ),
        "/",
        "~"
      ) & "~") - 1
    )
  )
)
